// Verified Network fee distribution
// (c) Kallol Borah, 2021

//"SPDX-License-Identifier: UNLICENSED"

pragma solidity 0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

import "./interfaces/ViaFactory.sol";
import "./interfaces/ISettlor.sol";
import "./interfaces/ILiquidity.sol";
import "./interfaces/IMarketMaker.sol";

import "./math/FixedPoint.sol";
import "./math/Math.sol";

contract Distribution is Ownable, Pausable {

    using FixedPoint for uint256;

    ViaFactory private factory;
    ILiquidity private liquidity;
    
    mapping(address => address[]) private businesses;
    mapping(address => uint256) private businessIndex;
    mapping(address => address[]) private operators;
    mapping(address => uint256) private operatorIndex;
    
    address private founder;
    address private treasury;
    address private liquidityContract;

    uint256 private immutable businessShare;
    uint256 private immutable founderShare;
    uint256 private immutable investorShare;
    uint256 private immutable operatorShare;

    event RevenueShare(bytes32 shareholderType, address indexed shareholder, address token, uint256 amount, uint256 timestamp);

    //revenue shares
    constructor(uint256 _business, uint256 _royalty, uint256 _investor, uint256 _operator){ 
        businessShare = _business;
        founderShare = _royalty;
        investorShare = _investor;
        operatorShare = _operator;
    }

    function getRevenueShares() external view returns(uint256, uint256, uint256, uint256){
        return (businessShare, founderShare, investorShare, operatorShare);
    }

    function initialize(address _viaFactory, address _founder, address _treasury, address _liquidity) public onlyOwner {
        factory = ViaFactory(_viaFactory);
        founder = _founder;
        treasury = _treasury;
        liquidityContract = _liquidity;
        liquidity = ILiquidity(_liquidity);
    }

    //Need to add shareholder for every Verified and other cash tokens supported on system
    function addRevenueShareholder(bytes32 _type, address _shareholder, address _currency) external onlyOwner {
        if(_type=="Business"){
            if(businessIndex[_shareholder] == 0){
                businesses[_currency].push(_shareholder);
                businessIndex[_shareholder] = businesses[_currency].length;
            }
        }
        else if(_type=="Operator"){
            if(operatorIndex[_shareholder] == 0){
                operators[_currency].push(_shareholder);
                operatorIndex[_shareholder] = operators[_currency].length;
            }
        }    
    }

    //Returns shareholders
    function getRevenueShareholders(bytes32 _type, address _currency) external view onlyOwner returns(address[] memory shareholders){
        if(_type=="Business")
            return businesses[_currency];
        else if(_type=="Operator")
            return operators[_currency];
    }

    //Returns payment fees
    function getPaymentFeeCollected(bytes32 _currency) external view onlyOwner returns(uint256){
        address cashToken = factory.getIssuer("ViaCash", _currency);
        if(cashToken!=address(0x0))
            return (IERC20(cashToken).balanceOf(address(this)));
        else
            return 0;
    }     

    //Returns bond issuing fees
    function getLoanFeeCollected(bytes32 _currency) external view onlyOwner returns(uint256){
        address bondToken = factory.getIssuer("ViaBond", _currency);
        if(bondToken!=address(0x0))
            return (IERC20(bondToken).balanceOf(address(this)));
        else
            return 0;
    }

    //Returns security issuing fees
    function getIssuingFeeCollected(address _platform, address _token) external onlyOwner returns(uint256){
        return (IMarketMaker(_platform).getIssuingFeeCollected(_token));
    } 

    //Returns security trading fees
    function getTradingFeeCollected(address _platform, address _token) external onlyOwner returns(uint256){
        return (ISettlor(_platform).getTradingFeeCollected(_token));
    }
    
    //Shares securities issuing and trading fees
    function shareCollection() external onlyOwner {
        ILiquidity.token[] memory tokens = liquidity.getSupportedTokens();        
        for(uint256 i=0; i<tokens.length; i++){
            uint256 fee = IERC20(tokens[i].tokenAddress).balanceOf(address(this));
            if(fee!=0){
                transfer(fee, tokens[i].tokenAddress, "collection");
            }
        }
    }

    //Shares payments and bond issuing fees
    function shareFee() external onlyOwner {
        uint256 tokenCount = factory.getTokenCount();
        for(uint i=0; i<tokenCount; i++){
            address token = factory.getToken(i);
            ( , bytes32 tokenType) = factory.getNameAndType(token);             
            if(tokenType=="ViaCash"){
                uint256 fee = IERC20(token).balanceOf(address(this));
                if(fee!=0){
                    transfer(fee, token, "fees");
                }
            }
            else if(tokenType=="ViaBond"){
                uint256 fee = IERC20(token).balanceOf(address(this));
                if(fee!=0){
                    transfer(fee, token, "fees");
                }
            }
        }
    }
    event distributionFee(uint256 fees, uint256 business, uint256 operator, uint256 founder, uint256 investor);
    //Transfers of revenue shares
    function transfer(uint256 fee, address token, bytes32 sharing) private {
        uint256 fees = _upscale(fee, _computeScalingFactor(IERC20(token)));
        uint256 businessFee = FixedPoint.divDown(FixedPoint.mulDown(fees, businessShare), _computeScalingFactor(IERC20(token)));
        uint256 operatorFee = FixedPoint.divDown(FixedPoint.mulDown(fees, operatorShare), _computeScalingFactor(IERC20(token)));
        uint256 founderFee = FixedPoint.divDown(FixedPoint.mulDown(fees, founderShare), _computeScalingFactor(IERC20(token)));
        uint256 investorFee = FixedPoint.divDown(FixedPoint.mulDown(fees, investorShare), _computeScalingFactor(IERC20(token)));
        emit distributionFee(fee, businessFee, operatorFee, founderFee, investorFee);
        if(sharing=="collection"){
            if(businessFee>0){ //50% of underwriting fees go to Liquidity contract to be paid out to liquidity providers
                IERC20(token).transfer(liquidityContract, businessFee);
                emit RevenueShare("Investor", liquidityContract, token, businessFee, block.timestamp);
            }
            if(founderFee>0 && businesses[token].length>0){ //15% of underwriting fees go to Verified businesses
                //founderFee = Math.divDown(_upscale(founderFee, _computeScalingFactor(IERC20(token))), _upscale(businesses[token].length
                //        , _computeScalingFactor(IERC20(token))));
                founderFee = Math.divDown(founderFee, businesses[token].length);
                for(uint j=0; j<businesses[token].length; j++){
                    IERC20(token).transfer(businesses[token][j], founderFee);
                    emit RevenueShare("Business", businesses[token][j], token, founderFee, block.timestamp);
                }
            }
            if(investorFee>0){ //15% of underwriting fees to the Liquidity contract to be paid out for IP
                IERC20(token).transfer(founder, investorFee);
                emit RevenueShare("Royalty", founder, token, investorFee, block.timestamp);
            }
            if(operatorFee>0){ //20% of underwriting fees go to the treasury for Vitta redemption (buyback) reserve
                IERC20(token).transfer(treasury, operatorFee);
                emit RevenueShare("Treasury", treasury, token, operatorFee, block.timestamp);
            }
            emit distributionFee(fees, businessFee, operatorFee, founderFee, investorFee);
        }
        else if(sharing=="fees"){
            //businessFee = Math.divDown(_upscale(businessFee, _computeScalingFactor(IERC20(token))), _upscale(businesses[token].length, _computeScalingFactor(IERC20(token))));
            //operatorFee = Math.divDown(_upscale(operatorFee, _computeScalingFactor(IERC20(token))), _upscale(operators[token].length, _computeScalingFactor(IERC20(token))));
            if(founderFee>0){ // 15% of fees go towards royalty payment for IP
                IERC20(token).transfer(founder, founderFee);
                emit RevenueShare("Royalty", founder, token, founderFee, block.timestamp);
            }
            if(investorFee>0){ //15% of fees go to Liquidity contract to be distributed to investors
                IERC20(token).transfer(liquidityContract, investorFee);
                emit RevenueShare("Investor", liquidityContract, token, investorFee, block.timestamp);
            }
            if(businessFee>0 && businesses[token].length>0){ //50% of fees go to Verified businesses
                businessFee = FixedPoint.divDown(businessFee, businesses[token].length);
                for(uint j=0; j<businesses[token].length; j++){
                    IERC20(token).transfer(businesses[token][j], businessFee);
                    emit RevenueShare("Business", businesses[token][j], token, businessFee, block.timestamp);
                }
            }
            if(operatorFee>0 && operators[token].length>0){ //20% of fees go to Verified Network node operators
                operatorFee = FixedPoint.divDown(operatorFee, operators[token].length);
                for(uint j=0; j<operators[token].length; j++){
                    IERC20(token).transfer(operators[token][j], operatorFee);
                    emit RevenueShare("Operator", operators[token][j], token, operatorFee, block.timestamp);
                }
            }
        }
    }

    /**
     * @dev Returns a scaling factor that, when multiplied to a token amount for `token`, normalizes its balance as if
     * it had 18 decimals.
     */
    function _computeScalingFactor(IERC20 token) internal view returns (uint256) {
        // Tokens that don't implement the `decimals` method are not supported.
        uint256 tokenDecimals = ERC20(address(token)).decimals();

        // Tokens with more than 18 decimals are not supported.
        uint256 decimalsDifference = Math.sub(18, tokenDecimals);
        return FixedPoint.ONE * 10**decimalsDifference;
    }

    /**
     * @dev Reverses the `scalingFactor` applied to `amount`, resulting in a smaller or equal value depending on
     * whether it needed scaling or not. The result is rounded down.
     */
    function _downscaleDown(uint256 amount, uint256 scalingFactor) internal pure returns (uint256) {
        return FixedPoint.divDown(amount, scalingFactor);
    }

    /**
     * @dev Applies `scalingFactor` to `amount`, resulting in a larger or equal value depending on whether it needed
     * scaling or not.
     */
    function _upscale(uint256 amount, uint256 scalingFactor) internal pure returns (uint256) {
        // Upscale rounding wouldn't necessarily always go in the same direction: in a swap for example the balance of
        // token in should be rounded up, and that of token out rounded down. This is the only place where we round in
        // the same direction for all amounts, as the impact of this rounding is expected to be minimal (and there's no
        // rounding error unless `_scalingFactor()` is overriden).
        return FixedPoint.mulDown(amount, scalingFactor);
    }

